import React, { Component } from 'react'
import Beach from './beach'

export default class Userbeaches extends Component {
    render() {
        let userbeachesArr = this.props.userbeaches.sort((a,b) => b.id - a.id)
        let user_id = this.props.user_id

        // let beaches = this.props.reviewBeaches
        // let userbeaches = beaches.filter(beaches.user_id === user_id)


        // console.log("user_id", this.props.user_id)
        // console.log("array of beach objects", userbeachesArr)
        if (userbeachesArr.length > 0){
        const userBeaches = userbeachesArr.map((userbeach) => {
            if (parseInt(userbeach.user_id) === user_id)
            {
            return <span>
                <div id="userbeach">
                    {/* {"userbeachID", console.log(userbeach.beach_id)} */}
                    <div key={userbeach.beach_id}>
                    <Beach beach={userbeach.beach}/>
                    {userbeach.name}
                    <br></br>
                    {/* <img id="userbeachphoto" 
                    src={userbeach.beach_id.photo_1}
                    alt="no_image_yet">
                    </img> */}
                    </div>
                    <button id="userbeachesbuttons" 
                    onClick={()=>this.props.deleteFromUBs(userbeach)}>
                    Delete from favorites.
                    </button>
                    <button id="userbeachesbuttons" 
                    onClick={()=>this.props.reviewBeach(this.props, userbeach.id)}>
                    Review this Beach
                    </button> 
                </div>
            </span>
            }else{
                return <span></span>}
            }    
        )
        }
        return (
            <div id="roundbutton">
                {/* <button id="roundbutton"
                        onClick={()=>this.props.returnHome(this.props)}
                        >
                        Return to Beachfinder Main
                        </button> */}
            <div id="favbeachbox">Favorite Beaches:
                {userBeaches}
                <div id="userbeach">
                </div>
            </div>
            </div>
        )
    }
}
